import React from 'react'; //we should import jsx, react is library from node modules

const Navbar = () => {
    return (
        <nav className='nav'>
            <div><a >Profiles</a></div>
            <div><a >Messages</a></div><div><a >News</a></div>
            <div><a >Music</a></div>
            <div><a >Settings</a></div>
        </nav>
    )
}

export default Navbar;
